import React from 'react';

interface PopupContentProps {
  content: string;
}

export const PopupContent: React.FC<PopupContentProps> = ({ content }) => {
  return (
    <div className="p-4">
      <h2 className="text-xl font-bold">Popup Content</h2>
      <p>{content}</p>
    </div>
  );
};
